INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("ぺコリーヌ", 150, 91002, 1, 1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 0, 8, 37, 107501, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("コッコロ", 150, 91002, 2, 1, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 0, 8, 38, 107601, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("キャル", 150, 91002, 3, 1, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 0, 8, 39, 107801, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("スズメ", 150, 91002, 4, 1, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 0, 8, 40, 107701, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("タマキ", 150, 91002, 5, 1, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 0, 8, 41, 107901, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("ぺコリーヌ", 150, 91002, 6, 2, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 0, 8, 42, 107501, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("コッコロ", 150, 91002, 7, 2, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 0, 8, 43, 107601, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("キャル", 150, 91002, 8, 2, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 0, 8, 44, 107801, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("スズメ", 150, 91002, 9, 2, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 0, 8, 45, 107701, 40001);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("タマキ", 150, 91002, 10, 2, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 0, 8, 46, 107901, 40001);
